INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 4, "2019/07/31 12:00:00", "カオリ（サマー）", 4, "2030/12/17 14:59:59", 10021, 1, 24015, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 1, "2019/07/31 12:00:00", "カオリ（サマー）", 4, "2030/12/17 14:59:59", 10021, 2, 24016, 4.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 4, "2019/07/31 12:00:00", "カオリ（サマー）", 4, "2030/12/17 14:59:59", 10021, 3, 24017, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 2, "2019/07/31 12:00:00", "カオリ（サマー）", 1, "2030/12/17 14:59:59", 10021, 4, 24018, 5.2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 6, "2019/07/31 12:00:00", "カオリ（サマー）", 5, "2030/12/17 14:59:59", 10021, 5, 24019, 4.2, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 2, "2019/07/31 12:00:00", "カオリ（サマー）", 2, "2030/12/17 14:59:59", 10021, 6, 24020, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 6, "2019/07/31 12:00:00", "カオリ（サマー）", 1, "2030/12/17 14:59:59", 10021, 7, 24021, 6.4, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 2, "2019/07/31 12:00:00", "カオリ（サマー）", 2, "2030/12/17 14:59:59", 10021, 8, 24022, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 3, "2019/07/31 12:00:00", "カオリ（サマー）", 6, "2030/12/17 14:59:59", 10021, 9, 24023, 10.08, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 2, "2019/07/31 12:00:00", "カオリ（サマー）", 1, "2030/12/17 14:59:59", 10021, 10, 24024, 5.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 110501);
INSERT INTO `v1_c2eec0e6dec3433f29edd568facb1dc5af237bd82719db1e8dfe87e267b3168b` VALUES (0.0, 24, 0.0, 2, "2019/07/31 12:00:00", "カオリ（サマー）", 2, "2030/12/17 14:59:59", 10021, 11, 24025, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 110501);
